import React from 'react';

class TilesList extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            tiles: props.tiles
        };
    }

    render() {
        return <ul>
            {this.state.tiles.map((tile) = <li>{tile}</li>)}
        </ul>
    }

}
export default TilesList;
